import React, { Component } from "react";
import ReactImage from "../Images/react.png";
import ClarifaiImage from "../Images/clarifai.png";
import NodeImage from "../Images/nodejs.png";

class About extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="list-group">
          <div
            className="list-group-item list-group-item-action active"
            style={{ background: "#282c34" }}
          >
            Technology
          </div>
          <div className="list-group-item list-group-item-action">
          <a href="https://reactjs.org/">

          </a>
            <img src={ReactImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>React.js - Client / Front End</h2>
          </div>
          <div className="list-group-item list-group-item-action">
          <a href="https://nodejs.org/en/">

          </a>
            <img src={NodeImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>Node.js - Server / Back End</h2>
          </div>
          <div className="list-group-item list-group-item-action">
            <a href="https://clarifai.com/">
            <img src={ClarifaiImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>Clarifai - Image Recognition</h2>

            </a>
        </div>
        </div>
      </React.Fragment>
    );
  }
}

export default About;
